import React from "react";
const Home = () => {
  const products=[
    { title: 'Cabbage', isFruit: false, id: 1 },
    { title: 'Garlic', isFruit: true, id: 2 },
    { title: 'Apple', isFruit: true, id: 3 },
  ]
  const filterproduct=products.filter(product=>product.isFruit)

  const itemlist=filterproduct.map((items)=>(
    <li key={filterproduct.id}
    style={{color:'red'}}>{filterproduct.title}</li>
  ))
  return (
    <div>
     {itemlist}
   </div>
  );
};

export default Home;
